import React from 'react';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import SingUpFrom from './SingUpForm';

const Content = () => {
	return (
		<Container>
			<Grid container direction='row-reverse' justify='center' alignItems='center' style={{ height: '77vh' }}>
				<Grid item style={{ direction: 'rtl', marginLeft: 40 }}>
					<h1 className='landing-content-heading'>تایپ آنلاین، به‌صرفه!</h1>
					<p className='landing-content-paragraph'>
						تیزتایپ همواره در تلاش است تا بهترین تجربه‌ی سفارش، انجام و تحویل پروژه‌های تایپ بصورت آنلاین را برای شما به
						ارمغان بیاورد.
					</p>
				</Grid>
				<Grid item>
					<SingUpForm />
				</Grid>
			</Grid>
		</Container>
	);
};

export default Content;
